    <div className="text-center">
      <h1>Bienvenue sur VetCare360</h1>
      <p>Gérez vos vétérinaires, propriétaires, animaux et visites.</p>
      <Link className="btn btn-primary m-2" to="/veterinaires">Voir les vétérinaires</Link>
      <Link className="btn btn-primary m-2" to="/proprietaires/recherche">Rechercher un propriétaire</Link>
    </div>






  );
}
